import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreatArea";

const App = () => {

    const [notes, setNotes] = useState([]);

    return <div>
        <Header />
        <CreateArea data={notes} setData={setNotes} />
        <Note/>
        <Footer />
    </div>
}

export default App;
